import React from "react";

const Sobre = () => {
  return (
    <React.Fragment>
      <div className="get-in-touch segments">
        <div className="container">
          <div className="section-title">
            <h3>Sobre nossa Loja</h3>
          </div>
          <div className="content">
            <p>
              A LeBrownie segue a receita original americana do Brownie, um doce
              Muito conhecido que foi criado por engano, depois de um bolo de
              Chocolate ter saído solado. Com isto começou a surgir o gostoso
              Brownie, que é hoje um dos doces de chocolate mais consumidos do
              Mundo.
            </p>
          </div>
        </div>
      </div>
    </React.Fragment>
  );
};

export default Sobre;
